description:
I found this on the net and I'm just sharing this.

Its a CAMRIP, so the quality is just ok.

Ppl rated the quality as 5/10, 5.5/10 etc.

Its watchable but if your're waiting for a better print, then I'd advise you not to go for this copy.

Cheers.

